import React, { Component } from 'react';
import '../../style/DiyCategoryStyle.css';
import DiyInfo from "./Diyinfo";

class DiyCategory extends Component{
    categoryClick1 = () => {
        this.props.onInput(1);
    }
    categoryClick2 = () => {
        this.props.onInput(2);
    }
    categoryClick3 = () => {
        this.props.onInput(3);
    }
    categoryClick4 = () => {
        this.props.onInput(4);
    }
    categoryClick5 = () => {
        this.props.onInput(5);
    }
    categoryClick6 = () => {
        this.props.onInput(6);
    }
    categoryClick7 = () => {
        this.props.onInput(7);
    }

    render(){
        const { selectedMotorData } = this.props;
        const { selectedWingsData } = this.props;
        const { selectedFrameData } = this.props;
        const { selectedControlBoardData } = this.props;
        const { selectedEscData } = this.props;
        const { selectedBatteryData } = this.props;
        const { selectedAntennaData } = this.props;
        const selectedMotorList = selectedMotorData.map(
            selectInfo => (
                <DiyInfo
                    key={selectInfo.id}
                    info={selectInfo}
                />)
        );
        const selectedWingsList = selectedWingsData.map(
            selectInfo => (
                <DiyInfo
                    key={selectInfo.id}
                    info={selectInfo}
                />)
        );
        const selectedFrameList = selectedFrameData.map(
            selectInfo => (
                <DiyInfo
                    key={selectInfo.id}
                    info={selectInfo}
                />)
        );
        const selectedControlBoardList = selectedControlBoardData.map(
            selectInfo => (
                <DiyInfo
                    key={selectInfo.id}
                    info={selectInfo}
                />)
        );
        const selectedEscList = selectedEscData.map(
            selectInfo => (
                <DiyInfo
                    key={selectInfo.id}
                    info={selectInfo}
                />)
        );
        const selectedBatteryList = selectedBatteryData.map(
            selectInfo => (
                <DiyInfo
                    key={selectInfo.id}
                    info={selectInfo}
                />)
        );
        const selectedAntennaList = selectedAntennaData.map(
            selectInfo => (
                <DiyInfo
                    key={selectInfo.id}
                    info={selectInfo}
                />)
        );
        return(
            <div className="category">
                <h2>Category</h2>
                <ul className="category-list">
                    <li onClick={this.categoryClick1}>{selectedMotorList}Motor</li>
                    <li onClick={this.categoryClick2}>{selectedWingsList}Wings</li>
                    <li onClick={this.categoryClick3}>{selectedFrameList}Frame</li>
                    <li onClick={this.categoryClick4}>{selectedControlBoardList}Control Board</li>
                    <li onClick={this.categoryClick5}>{selectedEscList}ESC</li>
                    <li onClick={this.categoryClick6}>{selectedBatteryList}Battery</li>
                    <li onClick={this.categoryClick7}>{selectedAntennaList}Antenna</li>

                </ul>
            </div>

        );
    }
}

export default DiyCategory;
